import React from "react";
import "./thankyou.css";
import { Container, Row, Col, Button } from "reactstrap";
import { Link } from "react-router-dom";

const Thankyou = () => {
  return <>
  <section>
    <Container>
        <Row>
            <Col lg='12'>
                <span><i className="ri-checkbox-circle-line"></i></span>
            </Col>
        </Row>
    </Container>
  </section>
  </>
};

export default Thankyou;
